import { NgModule } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';

import { AppComponent } from "./app.component";
import { BrowserModule } from "@angular/platform-browser";
import { GetRequestComponent } from './simpleHttpRequests/get-request/get-request.component';
import { PostRequestComponent } from './simpleHttpRequests/post-request/post-request.component';
import { PutRequestComponent } from './simpleHttpRequests/put-request/put-request.component';
import { DeleteRequestComponent } from './simpleHttpRequests/delete-request/delete-request.component';

@NgModule ({
    declarations: [
        AppComponent,
        GetRequestComponent,
        PostRequestComponent,
        PutRequestComponent,
        DeleteRequestComponent
    ],
    imports: [
        BrowserModule,
        HttpClientModule
    ],
    providers: [],
    bootstrap: [AppComponent]
})

export class AppModule{}
